      SELECT DISTINCT + col2 + - col1 * col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN - ( + col2 ) + - + 64 AND - + col0 * + col2 - col1 + 39;
  - name: tab0

outputs:
  - name: q3073.out
    data: |
